const expect = chai.expect;
import Vue from "vue/dist/vue.esm.js";
import Col from "../src/components/row-col/col.vue";
Vue.config.productionTip = false;
Vue.config.devtools = false;

describe("Col", () => {
  it("存在.", () => {
    expect(Col).to.exist;
  });
  it("接收 span 属性", () => {
    const div = document.createElement("div");
    document.body.appendChild(div);
    const Constructor = Vue.extend(Col);
    const vm = new Constructor({
      propsData: {
        span: 1,
      },
    }).$mount(div);
    const element = vm.$el;
    expect(element.classList.contains("col-1")).to.eq(true);
    div.remove();
    vm.$destroy();
  });

  it("接收 offset 属性", () => {
    const div = document.createElement("div");
    document.body.appendChild(div);
    const Constructor = Vue.extend(Col);
    const vm = new Constructor({
      propsData: {
        offset: 1,
      },
    }).$mount(div);
    const element = vm.$el;
    expect(element.classList.contains("offset-1")).to.eq(true);
    div.remove();
    vm.$destroy();
  });

  it("接收 pc 属性", () => {
    const div = document.createElement("div");
    document.body.appendChild(div);
    const Constructor = Vue.extend(Col);
    const vm = new Constructor({
      propsData: {
        pc: {span:1,offset:2},
      },
    }).$mount(div);
    expect(vm.$el.classList.contains("col-pc-1")).to.eq(true);
    expect(vm.$el.classList.contains("offset-pc-2")).to.eq(true);
    div.remove();
    vm.$destroy();
  });

  it("接收 ipad 属性", () => {
    const div = document.createElement("div");
    document.body.appendChild(div);
    const Constructor = Vue.extend(Col);
    const vm = new Constructor({
      propsData: {
        ipad: { span: 1, offset: 2 },
      },
    }).$mount(div);
    const element = vm.$el;
    expect(element.classList.contains("col-ipad-1")).to.eq(true);
    expect(element.classList.contains("offset-ipad-2")).to.eq(true);
    div.remove();
    vm.$destroy();
  });

  it("接收 narrow-pc 属性", () => {
    const div = document.createElement("div");
    document.body.appendChild(div);
    const Constructor = Vue.extend(Col);
    const vm = new Constructor({
      propsData: {
        narrowPc: { span: 1, offset: 2 },
      },
    }).$mount(div);
    const element = vm.$el;
    expect(element.classList.contains("col-narrow-pc-1")).to.eq(true);
    expect(element.classList.contains("offset-narrow-pc-2")).to.eq(true);
    div.remove();
    vm.$destroy();
  });

  it("接收 wide-pc 属性", () => {
    const div = document.createElement("div");
    document.body.appendChild(div);
    const Constructor = Vue.extend(Col);
    const vm = new Constructor({
      propsData: {
        widePc: { span: 1, offset: 2 },
      },
    }).$mount(div);
    const element = vm.$el;
    expect(element.classList.contains("col-wide-pc-1")).to.eq(true);
    expect(element.classList.contains("offset-wide-pc-2")).to.eq(true);
    div.remove();
    vm.$destroy();
  });
});
